import React from 'react';
import {
    BrowserRouter,
    Routes,
    Route,
  } from "react-router-dom";
import './cnt.css';
import CntTest from "./cnts/cnttest.js";
import CntTest2 from "./cnts/cnttest2.js";
import LeftMenu from './include/left_menu.js';

function CntTable(){
    return(
        <>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<CntTest />} />
                <Route path="homepage" element={<CntTest />} exact={true}/>
                <Route path="profile" element={<CntTest2 />} exact={true}/>
                
            </Routes>
        </BrowserRouter>   
        <LeftMenu />
        </>
    );
}

export default CntTable;
